    return{
        onFetchRolebyOrg:(organizationId,token ) =>dispatch(actions.fetchOrgRole(organizationId,token )),
        //onFetchOneEvents:(OrganizationId)=>dispatch(actions.fetchOneOrganizations(fundId))
    };
}


